import React from 'react';
import Recipe from './Recipe';
import '../styles/stylesheet.css'
class App extends React.Component<{name: string, image: string}, {}> {
    render(){
    const recipeList =[
         { name:'レシピ1',
           image:"./image_S_1.jpg"},
         { name:'レシピ2',
           image:"./image_S_2.jpg"},
          { name:'レシピ3',
           image:"./image_S_3.jpg"},
          { name:'レシピ4',
           image:"./image_S_4.jpg"},
          { name:'レシピ5',
           image:"./image_S_5.jpg"},
          { name:'レシピ6',
           image:"./image_S_6.jpg"},
          { name:'レシピ7',
           image:"./image_S_7.jpg"},
          { name:'レシピ8',
           image:"./image_S_8.jpg"},
          { name:'レシピ9',
           image:"./image_S_9.jpg"},
          { name:'レシピ10',
           image:"./image_S_10.jpg"}
      ];

    return (
      <div>
        <h1>レシピ一覧</h1>
        <div className='recipe'>
        {recipeList.map((recipeItem)=>{
            return(
            <Recipe
          name={recipeItem.name}
          image={recipeItem.image}
          />
            )
        })}


        </div>
      </div>
    );
  }
}

export default App;
